import React, { useEffect } from "react";
import useHover from "../src/hooks/useHover.js";

function SvgSmallStar({ position, entry, x, y, displayStatic, ...rest }) {
  console.log(entry);
  const deemphasisProps = entry.featured
    ? {}
    : {
        filter: "url(#monochrome)",
        transform: "translate(10,5) scale(0.7,0.7)",
      };

  const isInteractive = entry.featured || entry.inThePast;

  const otherGProps = isInteractive ? {} : { opacity: "0.3" };

  const [hoverRef, isHovered] = useHover();

  useEffect(() => {
    if (isHovered) {
      console.log("You are hovered right now!");
    } else {
      console.log("You are NOT hovered right now!");
    }
  }, [isHovered]);

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width={displayStatic || (isInteractive && isHovered) ? 70 : 50}
      height={displayStatic || (isInteractive && isHovered) ? 70 : 50}
      x={displayStatic || (isInteractive && isHovered) ? x - 10 : x}
      y={displayStatic || (isInteractive && isHovered) ? y - 10 : y}
      viewBox="0 0 37.5 37.5"
      {...rest}
    >
      <filter
        id="monochrome"
        color-interpolation-filters="sRGB"
        x="0"
        y="0"
        height="100%"
        width="100%"
      >
        <feColorMatrix
          type="matrix"
          values="0.95 0 0 0 0.05 
                      0.85 0 0 0 0.15  
                      0.50 0 0 0 0.50 
                      0    0 0 1 0"
        />
      </filter>
      <defs>
        <image
          id="small-star_svg__a"
          width={450}
          height={451}
          xlinkHref="data:image/png;base64,"
        />
        <image
          id="small-star_svg__c"
          width={450}
          height={451}
          xlinkHref="data:image/png;base64,"
        />
        <clipPath id="small-star_svg__b">
          <path d="M0 0h37.008v37H0zm0 0" />
        </clipPath>
        <mask id="small-star_svg__d">
          <use xlinkHref="#small-star_svg__a" />
        </mask>
      </defs>
      <g
        {...otherGProps}
        {...deemphasisProps}
        clipPath="url(#small-star_svg__b)"
      >
        <use
          ref={hoverRef}
          xlinkHref="#small-star_svg__c"
          mask="url(#small-star_svg__d)"
          transform="matrix(.08333 0 0 .08315 0 -.14)"
        />
      </g>
    </svg>
  );
}

export default SvgSmallStar;
